) In Amethyst, inputs can be either scalar inputs (a button that is either pressed or not), or axes (a range that represents an analog controller stick or relates two buttons as opposite ends of a range). In this file, we're creating two axes: W and S will move the left paddle up and down, and the Up and Down arrow keys will move the right paddle up and down. Next, we'll add an input bundle to the game's Application object, that contains an input handler system which captures inputs and maps them to the axes we defined. Let's make the following changes to main.rs . use amethyst::input::InputBundle; let binding_path = format!( "{}/resources/bindings_config.ron", env!("CARGO_MANIFEST_DIR")
); let input_bundle = InputBundle::<String, String>::new().with_bindings_from_file(binding_path)?; let game_data = GameDataBuilder::default() .with_bundle(TransformBundle::new())? .with_bundle(RenderBundle::new(pipe, Some(config)))? .with_bundle(input_bundle)?;
