use amethyst::ecs::{Join, Read, ReadStorage, System, WriteStorage};
use amethyst::input::InputHandler;
use pong::{Paddle, Side}; pub struct PaddleSystem; impl<'s> System<'s> for PaddleSystem { type SystemData = ( WriteStorage<'s, Transform>, ReadStorage<'s, Paddle>, Read<'s, InputHandler<String, String>>, ); fn run(&mut self, (mut transforms, paddles, input): Self::SystemData) { for (paddle, transform) in (&paddles, &mut transforms).join() { let movement = match paddle.side { Side::Left => input.axis_value("left_paddle"), Side::Right => input.axis_value("right_paddle"), }; if let Some(mv_amount) = movement { if mv_amount != 0.0 { let side_name = match paddle.side { Side::Left => "left", Side::Right => "right", }; println!("Side {:?} moving {}", side_name, mv_amount); } } } }
} Note: We had to make our Paddle and Side public in pong.rs Now lets add this system to our ApplicationBuilder in main.rs : mod systems; // in the run() function
let mut game = Application::build("./", Pong)? .with_bundle(TransformBundle::new())? .with_bundle(RenderBundle::new(pipe, Some(config)))? .with_bundle(input_bundle)? .with(systems::PaddleSystem, "paddle_system", &["input_system"]) .build()?; Take a look at the with method call. Here, we're not adding a bundle, we're adding a system alone. We provide an instance of the system, a string representing its name and a list of dependencies. The dependencies are the names of the systems that must be ran before our newly added system. Here, we require the input_system to be ran as we will use the user's input to move the paddles, so we need to have this data be prepared. Back in paddle.rs , let's review what our system does, because there's quite a bit there. We create a unit struct, called PaddleSystem , and implement the System trait for it. The trait specifies the lifetime of the components on which it operates. Inside the implementation, we define the SystemData the system operates on, a tuple of WriteStorage , ReadStorage , and Read . More specifically, the generic types we've used here tell us that the PaddleSystem mutates LocalTransform components, WriteStorage<'s, LocalTransform> , it reads Paddle components, ReadStorage<'s, Paddle> , and also accesses the InputHandler<String, String> resource we created earlier, using the Read structure. Then, now that we have access to the storages of the components we want, we can iterate over them. We perform a join operation between the Transform and Paddle storages. This will iterate over all entities that have both a Paddle and Transform attached to them, and give us access to the actual components, immutably for the Paddle and mutably for the Transform . There are many other ways to use storages. For example, you can use them to get a reference to the component of a specific type held by an entity, or simply iterate over them without joining. However in practice, your most common use will be to join over multiple storages as it is rare to have a system affect only one specific component. Please also note that it is possible to join over storages using multiple threads by using par_join instead of join , but here the overhead introduced is not worth the gain offered by parallelism.

